To conclude; As neither my Years nor Reading furniſh'd me with any great Advantages for this ESSAY, wherein too I've been wholly deſtitute of all foreign Aſſiſtance; So, no Pains hath been ſpar'd, which might conduce to make it Correct: Therefore, I hope, 'twill find the more Candid Conſtruction from the Ingenuous Peruſers: And to ſuch as may Diſlike it, I ſhall Addreſs my ſelf only with an Apology borrow'd from Horace;


— Si quid noviſti rectius iſtis,

Candidus imperti: Si non, his utere mecum.

